/**
 * @function ODD
 * @memberof GridMath
 * @description
 *    {lang=en} Rounds a number up to the nearest odd integer
 *    {lang=ja} 数値を切り上げ、最も近い奇数にします
 *    {lang=zh} 将一个数字向上舍入到最近的奇数
 *    {lang=hant} 將一個數字向上舍入到最近的奇數
 *    {lang=ko} 가장 가까운 홀수인 정수로 숫자를 올림
 *    {lang=ru} Rounds a number up to the nearest odd integer
 *    {lang=de} Rundet eine Zahl auf die nächste ungerade Ganzzahl auf
 * @param  {number} num
 *    {lang=en} Number
 *    {lang=ja} 数値
 *    {lang=zh} 数字
 *    {lang=hant} 數字
 *    {lang=ko} 숫자
 *    {lang=ru} Number
 *    {lang=de} Zahl
 * @return {number}
 * @example
 *    =ODD(3.152)
 */
GridMath["ODD"] = function(num) { //
	num = Math.ceil(num);
	if((num % 2) === 0) {
		return (num < 0) ? num - 1 : num + 1;
	}
	return num;
};

