/**
 * @function CLEAN
 * @memberof Text
 * @description
 *   {lang=en} The CLEAN function removes non-ASCII characters, (characters not in the range 32-127 inclusive), from the string.
 *   {lang=ja} CLEAN 関数は、ASCII 以外の文字 (32-127 の範囲にない文字) を文字列から削除します。
 *   {lang=zh} CLEAN 函数从字符串中删除非 ASCII 字符 (不在 32-127 范围中的字符)。
 *   {lang=hant} CLEAN 函數從字符串中刪除非 ASCII 字符 (不在 32-127 範圍中的字符)。
 *   {lang=ko} CLEAN 함수는 문자열에서 비 ASCII 문자(32-127 범위에 없는 문자)를 제거합니다.
 *   {lang=ru} The CLEAN function removes non-ASCII characters, (characters not in the range 32-127 inclusive), from the string.
 *   {lang=de} Die Funktion SÄUBERN entfernt Nicht-ASCII-Zeichen (Zeichen, die nicht im Bereich 32-127 einschließlich liegen) aus der Zeichenfolge.
 * @param {string} text
 *   {lang=en} Text
 *   {lang=ja} 文字列
 *   {lang=zh} 文本
 *   {lang=hant} 文本
 *   {lang=ko} 텍스트
 *   {lang=ru} Text
 *   {lang=de} Text
 * @return {string}
 * @example
 *    =CLEAN("Kobérña")
 */
Text["CLEAN"] = function(text) {
	var arrText = _toString(text).split("");
	for(var i = arrText.length; --i >= 0;) {
		var ascii = arrText[i].charCodeAt(0);
		if(ascii < 32 || ascii > 127) {
			arrText[i] = "";
		}
	}
	return arrText.join("");
};
