		var queryUrl = SYNAPSE_URL
			+ '&api-key=' + encodeURIComponent(synapse.apiKey)
			+ '&contextApp=' + encodeURIComponent(synapse.contextApp)
			+ '&language=' + encodeURIComponent(FieldDefinition._lang)
			+ '&query=' + encodeURIComponent(field);
