CellPainter.prototype._blinkCondition = null;
/** @type {!Array}
* @private
*/
CellPainter.prototype._scopes;
/** @type {number}
* @private
*/
CellPainter._runningBlinkId = 0;


/** @type {Array.<CellPainter>}
* @private
* @const
*/
CellPainter._painters = [];

/** @type {!Array}
* @private
* @const
*/
CellPainter._emptyAry = [];
/** @type {!Object}
* @private
* @const
*/
CellPainter._emptyObj = {};
/** @type {!Object}
* @private
* @const
*/
